PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE airports(
   id INTEGER,
   airport TEXT,
   city TEXT,
   country TEXT,
   IATA VARCHAR(4),
   ICAO VARCHAR(4),
   latitude NUMERIC,
   longitude NUMERIC,
   altitude INTEGER,
   TMZ INTEGER,
   DST INTEGER,
   timezone TEXT,
   PRIMARY KEY(id)
);
CREATE TABLE airlines(
   id INTEGER,
   airline TEXT, 
   IATA VARCHAR(3),
   ICAO VARCHAR(4),
   callsign TEXT,
   country TEXT,
   active CHAR(1),
   PRIMARY KEY(id)
);
COMMIT;
